def copy_bytes(destination, source, num_bytes):
    """
    Copies 'num_bytes' worth of data from 'source' to 'destination'.

    Args:
        destination: The buffer where the data is copied.
        source: The buffer containing the original data.
        num_bytes: Number of bytes to copy.
    """
    try:
        # Check if both are byte arrays or buffers
        if hasattr(source, 'buffer_info') and hasattr(destination, 'buffer_info'):
            # Using memoryview for safe copying between different buffer types (like bytearray and bytes)
            memory_view = memoryview(source).cast('B', num_bytes)  # Cast to unsigned byte array

            try:
                destination.write(memory_view.tobytes())
            except TypeError:
                # If destination doesn't accept write method, use assignment
                dest_data = memory_view.cast('B')
                for i in range(num_bytes):
                    destination[i] = source[i]
        else:
            # Fallback to direct copying if the objects don't have buffer_info (like str)
            try:
                data_to_copy = source[:num_bytes]
                destination.value = data_to_copy  # Assuming it's a string attribute
            except AttributeError:
                # If neither is designed with buffers, convert both to bytes and then copy
                data_to_copy = bytes(source[:num_bytes])
                destination[:] = data_to_copy

    except Exception as e:
        print(f"Copy failed: {e}")

    return num_bytes  # Return the length of copied bytes

